import React from 'react';

var style = {
    backgroundColor: "#5ba7dc",
    textAlign: "center",
    padding: "20px",
    left: "0",
    bottom: "0",
    height: "25px",
    width: "100%",
}

function Footer() {
    return (
        <div>
            <div style={style} />
        </div>
    )
}

export default Footer;
